import './topbar.css'
import { useSelector } from 'react-redux'

export default()=>{
    const {auth} = useSelector(state=>state)
    return(
        <div className="topbar">
            {auth.admin &&  <h2>Logged in as: Demo Admin </h2> }

            <input type="text" placeholder="Search.."></input>
        </div>
    )
}
